value.raw:
html, body { margin: 0; padding 0; }
* { box-sizing: border-box; }
body {
  background: #e8e8e8;
  color: #333;
  font-family: sans-serif;
  padding: 30px;
  margin: 0;
}

#application {
  max-width: 90%;
  padding: 30px;
  margin: 0 auto;
  background: #fff;
  border-radius: 4px;
}
.label {
  text-transform: uppercase;
  color: #999;
}
h1 {
  font-size: 25px;
  letter-spacing: -0.04em;
  border-bottom: 1px solid #d0d0d0;
  padding-bottom: 0.5em;
  margin-bottom: 1em;
}
pre {
  background: #e8e8e8;
  overflow:scroll;
  padding: 12px 15px;
  border: 1px solid #d0d0d0;
  border-radius: 4px;
  line-height: 1.3;
}

